 (10,NULL,NULL,'高永强','13998618869','总经理','甘-10-1','大连中远船务工程有限公司是中远船务工程集团旗下的核心企业之一。公司以船舶与海洋工程产品的修理、改装、制造为主业。公司位于环渤海湾港口群的要冲、美丽的滨海城市大连。占地120万平方米，岸线总长3200米，市场遍及欧、美、亚多个国家和地区。公司拥有30万吨级浮船坞、15万吨级浮船坞和8万吨级干船坞各1座，坞容总量达到53万吨；专用修船码头8座，配有3台200吨门式起重机，1台400吨门式起重机等各类配套吊运设施。公司于2007年进军船舶制造领域，目前拥有钢加工、分段装焊、管子加工、涂装等厂房共计12万平方米，5000吨、10000吨级船台各1座，以及年处理能力达20万吨的钢材预处理流水线等多个重要生产设施。近年来，大连中远船务顺应形势发展，坚持改革创新，市场地位和品牌价值不断提升，综合实力和业务范围不断扩大，实现了从单一修船到修船、造船、海工三业并举的产品转型。公司拥有OBO、PCTC、VLCC、VLOC、FPSO等多种特殊船型的修理和改装实力，先后成功改装完成了“海洋骄傲”、“太阳神松寿”、“卡普”、“柏松”、“旭日东升”等多个FPSO，被业界誉为“中国第一FPSO改装工厂”。公司还承接了世界最大深水钻井船、系列JACK-UP自升式钻井平台、小型LNG运输船、3万吨教学实习船、PSV、DSV、12000吨抬浮力打捞工程船、模块运输船、22000吨成品油轮以及系列30000吨重吊船、57000吨散货船、80000吨散货船、82000吨散货船、92500吨散货船等海工和船舶建造项目，并为韩国三星自主设计建造了世界最大的50万吨级浮船坞。公司于2011年被评定为“国家高新技术企业”。','4771fdc4-7c5f-4be5-963c-643c89a26a48','2017-12-05 00:10:18.0652848',NULL,NULL,'2017-12-05 00:11:10.3107254','4771fdc4-7c5f-4be5-963c-643c89a26a48','大连中远船务工程有限公司','','','',NULL,200,12,'企业',0),
 (11,NULL,NULL,NULL,NULL,NULL,'甘-10-2','中国第一重型机械集团大连加氢反应器制造有限公司（以下简称“大连加氢公司”）是中国第一重型机械股份公司的全资子公司，位于大连市甘井子区大连湾镇棉花岛，注册资金204,868万元，厂区三面临海，交通便利。中国一重集团一直以建设成为具有国际竞争力的大型企业集团为目标，不断开拓进取。为走向世界、做大做强积极调整发展战略。一重的主要产品是关系到国民经济的重要产品属于大型、超大型设备，加氢反应器单台最重可达2000吨，大型成套轧制设备的单个机架重量可达300吨左右，陆路根本无法运出，必须有临港码头，公司总部正是受到大型产品运输的限制，为了容器产品可直接出口以及更长远的发展，选择了在大连注册子公司，自行建造3000T级码头，主要用于大型、超大型设备的运输，为企业在国际市场上具有一定的竞争优势创造更好的条件。在秦山核电公司60万千瓦级核反应堆压力容器、稳压器制造成功的基础上，由我公司承制的我国首台完全自主化红沿河核电站1#机组百万千瓦级核反应堆压力容器发往红沿河，此举标志着我国百万千瓦级核岛主设备已完全实现国产化，达到了国际先进水平，标志着我公司核电主设备方面又取得了重大、阶段性的突破，为后续产品制造积累了宝贵的经验。几年的发展过程中荣获过很多的奖项。','4771fdc4-7c5f-4be5-963c-643c89a26a48','2017-12-05 00:10:59.5463478',NULL,NULL,NULL,NULL,'一重加氢公司','','','',NULL,200,12,'企业',0),
