 (13,NULL,NULL,'陈继状','87125687','法人','甘-10-4','辽宁省大连海洋渔业集团公司（简称辽渔集团） 坐落于辽东半岛大连湾畔，始建于1945年，是省属国有独资的综合性大型渔业联合企业。企业资产总值达94亿元，员工6000余人，海陆域总面积近300万平方米，目前已形成集海洋捕捞、港口航运、水产品交易、水产品加工、冷藏、国内外营销、船舶修造、地产开发、物资供应等多产业多元化的经营格局，成为国内同行业最具综合规模优势、产业链条最为完整的现代化渔业基地。“十三五”期间，辽渔集团将致力建设成为以海洋为依托，以海洋食品为龙头，以捕捞、冷藏、渔港、客滚、修造船、水产品贸易、食品加工、冷链物流为支撑的全产业链的现代服务型企业集团。','4771fdc4-7c5f-4be5-963c-643c89a26a48','2017-12-05 00:12:05.8478873',NULL,NULL,NULL,NULL,'辽宁省大连海洋渔业集团','','','',NULL,200,12,NULL,0),
 (14,NULL,NULL,'杨树华','13842619009','法人','甘-10-5','大连远辰客运有限公司是原辽宁省大连海洋渔业集团下属公司，为落实国家大型国有企业主辅分离政策，2003年9月从辽宁省大连海洋渔业集团公司分离出来，经辽宁省国资委和大连市体改委批准改制，由大连市工商局批准注册成立大连市远辰运输有限公司，2006年更名为大连远辰客运有限公司。公司占地20000平方米，建筑面积4000平方米。公司下属公交客运分公司、环路客运分公司、旅游通勤分公司、汽车出租分公司、货运分公司、大连湾维修厂、金南路修配厂、加油站（正在动迁中）、三元水产冷库九个经营实体。现有职工287人，营运车辆160辆，固定资产4068万元。公司是从1992年开始从事道路客运，2005年开始将近郊长途客运实行公交化管理，特别是公司所在地变成城市街道后，加快了公交化进程，公司现有客运线路青泥洼桥至大连湾、解放路至大连湾、解放路至大连湾快速班线，青泥洼桥至前关、苏家工业区至姚家、湾环1、2、3、4路、大连湾至拉树房、大连湾至北乐、甘井子至棋盘十一条线路。','4771fdc4-7c5f-4be5-963c-643c89a26a48','2017-12-05 00:12:33.6037608',NULL,NULL,NULL,NULL,'大连远辰客运有限公司','','','',NULL,200,12,NULL,0),
 (15,NULL,NULL,NULL,NULL,NULL,'甘-10-6','华能大连电厂坐落在大连湾海边，靠近大连经济技术开发区，距市中心约30公里。该厂以合资方式始建于1986年，主要利用外资成套引进了80年代具有国际先进水平的现代化设备，1988年建成投产。一期工程投用的两套火力发电机组，具有70万千瓦的发电能力。几年来，该厂年发电量都在38亿度以上，工厂生产的全过程基本实现了自动化控制。
