 (36,NULL,NULL,NULL,'18900998376','董事长','甘-10-28','大连宝荣机械化工程有限公司成立于1999年8月，是一家从事土石方工程施工以及石料加工运输的较大型民营股份制企业。公司现有高中级职称人员30人，持证上岗人员30人。拥有各类工程施工机械设备101台（套），其中：小松300以上型挖掘机15台，装载机12台，DM351钻机4台，15吨以上型载重自卸汽车70台。公司拥有总资产9400万元，年总产值1.25亿元。
公司自成立以来秉承“团结、务实、开拓、进取”的企业精神，遵循“守合同、守信用”、“质量第一、信誉第一”的服务宗旨。致力为国家建设，为业主提供高效、快速、优质的服务。由于，公司对内深化改革，对外充分发挥企业优势，努力拓展国内市场，不断提高经济效率和社会效益，壮大了企业综合实力。公司先后在大连、山东等地城建各类大、中型土石方工程100多项。工程一次性验收合格率为100%，优良率86%，还有不少工程被评为优质工程。
2005年公司承揽大连湾港区通用杂货泊位堆截区土石方倒运工程，工程总造价7100万元，2006年公司承揽大连长兴岛通用泊位陆域回填工程，工程总造价8000万元，2007年公司承揽大连船舶海洋工程建造基地一期工程，工程总造价8000余万元。公司年产值、年利润每年都在飞速递增。集体经济巩固了，势力加强了，诸多工程都在向我们招手。08年旅顺建港近亿元的工程，我公司已投标并中标，目前已进入工程的前期准备工作，预计年利润将达千万元。
今后，公司将一如既往的为各界用户提供高技术、高质量、高效率的服务。同时希望在各工程领域能得到同仁的支持和合作，创造出更多更好的优质工程、精品工程，共创美好的未来。
