 (42,NULL,NULL,'张玉宝','13204057199','村委书记','甘-10-21',' 大连湾地处辽东半岛最南端的海湾，隶属于大连市甘井子区。水土资源丰富，具有可观价值，建有大连港（大连港、香炉礁杂货港、和尚岛煤港和大连新港）以及大窑湾港（新建），构成巨大的港口群。大连港年吞吐量达7600万吨。大连港位于湾南岸，大连造船厂位于湾西岸，大连钢铁（大钢）、大连石化（大化）位于造船厂东北湾岸。甘井子区大连湾街道大房身村归大连湾街道管理、毗连子校家属社区、前关村、李家村、大连湾村,茂林成荫,花团锦簇,社会和谐稳定','4771fdc4-7c5f-4be5-963c-643c89a26a48','2017-12-05 00:22:51.2988856',NULL,NULL,NULL,NULL,'大房身村','','','',NULL,200,12,NULL,0);
